bioghist.p:
In 1954 bestaan de taken van de DML uit: 

Verwerving en keuring van materieel;

Productie en herstel van materieel;

In- en uitvoer, transport en beheer van materieel;

Logistieke problemen die samenhangen met industriële oorlogsvoering;

Wetenschappelijk onderzoek naar materieel;

Onderhouden van contacten met de industrie en handel.

In december 1976 werd de zogenaamde matrix-organisatie voor het Ministerie van Defensie ingevoerd. Bij de drie krijgsmachtdelen werden directies ingesteld voor de functiegebieden operatiën, personeel, materieel en economie & financiën. Zowel de hoofden van de centrale organisatie, de directeuren-generaal en de chef Defensiestaf, als de hoofden van de directies van de krijgsmachtdelen, de directeuren personeel, materieel, economie & financiën en de chef (Marine)staf, stonden rechtstreeks onder de leiding van het ministerie. Dit betekende in principe dat afdelingshoofden van de directies van de krijgsmachtdelen zowel onder hun eigen hiërarchische directeur of chef staf vielen als ook aanwijzingen vanuit de centrale organen konden krijgen, hetgeen kenmerkend is voor een matrix-organisatie. De directie bestaat dan uit de volgende afdelingen:  

Controller, beleid en plannen;

Bedrijfsvoeringssytemen;

Wetenschappelijk onderzoek;

Vliegtuigen;

Grondsystemen;

Ondersteunende systemen;

Verwerving en Contracten.

De taken zijn dan in hoofdlijnen:


De zorg voor de totstandkoming van het concept materieel deelplan van de Koninklijke Luchtmacht;

De zorg voor het opstellen en na goedkeuring uitvoeren van realisatie materieelplan en Koninklijke Luchtmacht;

Het op basis van aanwijzingen van de directeur-generaal materieel (doen) verrichten van wetenschappelijk onderzoek van relevante toekomstige technische ontwikkelingen op het gebied van het materieel van de Koninklijke Luchtmacht. Het uitwerken van de technische en kwaliteitseisen van het materieel, waaronder het identificeren, het voorbereiden van de codificatie en documentatie; het medewerken aan normalisatie en standaardisatie van het materieel bij de Koninklijke Luchtmacht een en ander gelet op de aanwijzingen en richtlijnen van de directeur-generaal materieel;

Het verwerven van roerende en onroerende goederen en diensten volgens de ter zake gegeven aanwijzingen en richtlijnen van directoraat-generaal materieel;

Het uitoefenen van de kwaliteitszorg in relatie tot het voorzien in en het in stand houden van het materieel van de Koninklijke Luchtmacht;

De zorg voor de voorraadvorming, opslag, distributie en eventueel afvoeren van het materieel van de Koninklijke Luchtmacht gelet op de aanwijzingen en richtlijnen van de directeur-generaal materieel;

Het opstellen van onderhoudprogramma’s voor het materieel, het doen uitvoeren van reparatie- en onderhoudswerkzaamheden;

Het verstrekken van functionele aanwijzingen en richtlijnen voor de bedrijfsvoering van de specifieke bevoorradings- en onderhoudactiviteiten van de koninklijke luchtmacht en de controle op de naleving ervan;

Het verrichten van activiteiten op materieelgebied ten behoeve van meer dan een krijgsmachtsdeel, zulks op aanwijzing van de directeur-generaal materieel;

Het deelnemen aan internationaal overleg op materieelgebied, gelet op de aanwijzingen van de directeur-generaal materieel.

